import {Link} from 'react-router-dom'
const NavBar = () => {
    return ( 
        <div>
            <ul>
                <Link to='/posts'><li>Click Here To View Data In Table!</li></Link>
                <Link to='/ApiJson'><li>Click Here To View Data !</li></Link>
            </ul>
        </div>
     );
}
export default NavBar;
